import "./App.css";
import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import Users from "./pages/Users";
import Logout from "./pages/Logout";
import Albums from "./pages/Albums";
import Todos from "./pages/Todos";
import Posts from "./pages/Posts";
import Login from "./pages/Login";
import Info from "./pages/Info";
import Photos from "./pages/Photos";

function App() {
  fetch("https://jsonplaceholder.typicode.com/todos/1")
    .then((response) => response.json())
    .then((json) => console.log(json));
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/Login" element={<Login />} />
        <Route path="/" element={<Navigate to="/Login" />} />
        <Route path="Users" element={<Users />}>
          <Route path=":id/Posts" element={<Posts />} />
          <Route path=":id/Todos" element={<Todos />} />
          {/* <Route path="Logout" element={<Logout />} /> */}
          <Route path=":id/Albums" element={<Albums />}></Route>
          <Route path=":id/Albums/:id/Photos" element={<Photos />} />
          {/* <Route path=":userId/Albums/:albumId/Photos" component={Photos} /> */}
          <Route path=":id/Info" element={<Info />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
